import React, { useState, useEffect} from 'react'
import axios from '../../utils/axios';

const GetRecipes = () => {
    const [recipe, setRecipe] = useState([])

    useEffect(() => {
        async function fetchRecipes() {
            const request = await axios.get("/api/recipes")
            console.log(request)
        }
        fetchRecipes();
    }, [recipe])
}

export default GetRecipes
